import React from "react";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import { Table, TableCell, TableHead, TableRow } from "@material-ui/core";

export default function Order() {
  return (
    <>
      <Grid container spacing={1} justifyContent="center">
        <Grid item xs={12} className="my-5 text-center">
          <Typography variant="h4" className="font-family-Ad" color="white ">
            My Products
          </Typography>
        </Grid>
        <Grid item xs={12}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell className="text-white">STT</TableCell>
                <TableCell className="text-white">Name Product</TableCell>
                <TableCell className="text-white">Date Time</TableCell>
              </TableRow>
            </TableHead>
          </Table>
        </Grid>
      </Grid>
    </>
  );
}
